import './App.css';
import React from 'react';
import { css } from '@emotion/react'
import Nav from 'react-bootstrap/Nav';
import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';
import 'bootstrap/dist/css/bootstrap.min.css';

const space = css`
  margin-top: 500px;
`;

function App() {
  return (
    <div className="App">
      <div>
        <Nav className="justify-content-end" activeKey="/home">
          <Nav.Item>
            <Nav.Link href="/home">Todo</Nav.Link>
          </Nav.Item>
          <Nav.Item>
            <Nav.Link eventKey="link-1">Contact</Nav.Link>
          </Nav.Item>
        </Nav>
      </div>
      <div>
        <p className={`Title ${space}`}>Todo</p>
        <Nav className="justify-content-center" activeKey="/home">
          <Nav.Item>
            <Nav.Link href="/home">All</Nav.Link>
          </Nav.Item>
          <Nav.Item>
            <Nav.Link eventKey="link-1">Completed</Nav.Link>
          </Nav.Item>
          <Nav.Item>
            <Nav.Link eventKey="link-2">Incompleted</Nav.Link>
          </Nav.Item>
        </Nav>

        <Form.Control
          type="text"
          id="inputTodo"
          aria-describedby="todoInputBlock"
          placeholder="Type..."
          css={css`
            width: 50px;
          `}
        />
        <Button variant="dark">+</Button>
      </div>

    </div>
  );
}
export default App;
